import React from "react";
import {GameItem} from './gameitem';  // import the GameItem presentation component

export class Games extends React.Component{
  render(){
    return this.props.games.map(
      (game)=>{
        return <GameItem game={game} price={game.price} Reload={this.props.Reload} handleBid={this.props.handleBid} handleBuyNow={this.props.handleBuyNow} />

      }
    );
  }
}
